import React from 'react'

const TopButtons = ({setQuery}) => {

    const cities = [
        {
            id: 1,
            title: 'London'
        },
        {
            id: 2,
            title: 'Sydney'
        },
        {
            id: 3,
            title: 'Boston'
        },
        {
            id: 4,
            title: 'New York'
        },
        {
            id: 5,
            title: 'Celebrations'
        },
    ]

  return (
    <div className='flex items-center justify-evenly my-6 '>
        {cities.map((city) => (
            <button onclike key={city.id} className='text-white textlg font-medium'>{city.title}</button>
        ))}
    </div>
  )
}

export default TopButtons
